import React, { useState, Component, useContext } from "react";
import { StyleSheet, View } from "react-native";
import { COLORS, FONTS } from "../constants/theme";
import Pcik from "./pcik";
const Add = () => {
  return (
    <View style={{ flex: 1 }}>
      <Pcik />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    textAlign: "center",
    justifyContent: "center",
  },

  container2: {
    flex: 1,
    backgroundColor: "#2A3C44",
    textAlign: "center",
  },
  head: {
    borderBottomWidth: 2,
    borderColor: "white",
    padding: 6,
    borderRadius: 25,
  },
  wrapper: { flexDirection: "row" },
  title: { flex: 1, backgroundColor: "#2A3C44", borderRadius: 25 },
  row: { height: 45 },
  text: {
    color: "white",

    ...FONTS.body4,
    marginHorizontal: 4,
    textAlign: "center",
    borderRadius: 25,
  },
});
export default Add;
